import React from "react";

class Input extends React.Component {
  render() {
    const { value, onChange, text, name, type } = this.props
    return (
      <div>
        <label>{text}
          <input type={type} name={name} value={value} onChange={onChange} />
        </label>
      </div>
    )
  }
}

export default Input
